import React from "react";

const Favourites = (props) => {
  let favMovieList = props.favList.map((url, index) => {
    return (
      <div key={index} id={index} className="fav">
        <img alt="" src={url} />
        <button onClick={props.onClick}>Remove</button>
      </div>
    );
  });

  return <div className="favContainer">{favMovieList}</div>;
};
export default Favourites;
